import React from 'react'
import styles from "../../assets/styles/components/Error/Error.module.css"
import image from "../../assets/img/not found.png"

const Error = () => {
  return (
    <div className={styles.content}>
      <h1>Page not found</h1>
      <div>
        <img src={image} alt="" />
      </div>
      <h3>Error 404</h3>
    </div>
  )
}

export default Error;
